import React from "react";
import { View, Text, Pressable } from "react-native";
import { useState } from "react";
import { style } from "../stylesheets/navbarstyle";

interface VisibilityProp {
    visible: boolean
}

export default function Circles({visible} : VisibilityProp) {

    if(visible) {
        return (
            <View id="wrapper" style={style.circles_wrapper}>
                <Pressable id="circle-diets" style={style.circle_diets}></Pressable>
                <Pressable id="circle-programs" style={style.circle_progs}></Pressable>
                <Pressable id="circle-forum" style={style.circle_diets}></Pressable>
            </View>
        )
    }
}
